import React from "react";

import Heading from './Heading';
import Paragraph from './Paragraph';
import List from './List';
import Greeting from "./Greeting";

function  App(){
    return(
        <>
            <Greeting/>
            <Heading/>
            <Paragraph/>
            <List/>
            
        </>
    );
}
export default App;
